import React, { useState } from "react";

const NavBar = () => {
    const [activeLink, setActiveLink] = useState("home");

    const handleLinkClick = (linkName) => {
        setActiveLink(linkName);
    };

    return (
        <nav className="navbar navbar-expand-md navbar-light fixed-top">
            <button className="navbar-toggler" type="button" data-togle="collapse" data-target="#navbarNavDropdown" aria-controls="navbarNavDropdown" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navebar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarNavDropdown">
                <ul className="list-unstyled text-lg-right ml-auto fontsize3" style={{ fontWeight: 'bold' }}>
                    <li className="nav-link font-weight-bolder">
                        <a 
                            className={`fontcolor1 ${activeLink === "home" ? "active" : ""}`} 
                            href="#home"
                            onClick={() => handleLinkClick("home")}
                        >
                            HOME
                        </a>
                    </li>
                    <li>
                        <a 
                            className={`fontcolor1 font-weight-bolder ${activeLink === "about_me" ? "active" : ""}`} 
                            href="#about_me"
                            onClick={() => handleLinkClick("about_me")}
                        >
                            ABOUT ME
                        </a>
                    </li>
                    <li>
                        <a 
                            className={`fontcolor1 font-weight-bolder ${activeLink === "education" ? "active" : ""}`} 
                            href="#education"
                            onClick={() => handleLinkClick("education")}
                        >
                            EDUCATION
                        </a>
                    </li>
                    <li>
                        <a 
                            className={`fontcolor1 font-weight-bolder ${activeLink === "expertise" ? "active" : ""}`} 
                            href="#expertise"
                            onClick={() => handleLinkClick("expertise")}
                        >
                            EXPERTISE
                        </a>
                    </li>
                </ul>
            </div>
        </nav>
    )
};

export default NavBar;
